            F1[n-1] = np.real(np.dot(np.dot(np.matrix(idealstate1).getH(), rho), idealstate1)[0,0])
            F2[n-1] = np.real(np.dot(np.dot(np.matrix(idealstate1).getH(), rho), idealstate1)[0,0])
